import './Card.css';
// import cardImage from'../../images/51-3.png';

export default function Card({image}) {

  return (
    <li className='card'>
      <a href='#'>
        <img className='card__image' src={image}/>
      </a>
      <div className='card__description-area'>
        <span className='card__price'>9700 &#8381;</span>
        <h2 className='card__header'>Комплект с аметистовыми друзами</h2>
      </div>
      
    </li>
  )
}
